import Counter from '../components/Counter'
import Cards from '../components/Cards'
import fetch from 'node-fetch'

export default function Index({ data }) {
  return (
    <div>
      <Layout>
        <h1>Hello Next.js</h1>
        <p>root page</p>
        <Counter />
        <Cards data={data} />
      </Layout>
    </div>
  );
}


